    { 
        bicycleType: 'AA', amount: 35 
    },
    { 
        bicycleType: 'BB', amount: 5298
    },
    { 
        bicycleType: 'CC', amount: 1987
    },
    { 
        bicycleType: 'DD', amount: 954
    },
    { 
        bicycleType: 'EE', amount:  68
    },

];

export default function DataGridDemo() 
{
    return (
        <div 
            style={{ height: 400, width: '100%' }}
        >
            <DataGrid 
                rows=
                {
                    rows
                } 
                columns=
                {
                    columns
                } 
                pageSize=
                {
                    5
                } 
                checkboxSelection 
            />
        </div>
    );
}
